import "./Post.css";

const Post = () => {
  return (
    <div className="post">
      <img className="post-img" src="" alt="post_img" />
      <div className="post-info" >
      <div className="post-cats" >
      <span className="post-cat">Music</span>
      <span className="post-cat">Life</span>
      </div>
      </div>
    </div>
  );
};
export default Post;
